export const VendorSpendRedeemer = Contracts.Import("VendorSpendRedeemer");
export type VendorSpendRedeemer = Exact<typeof VendorSpendRedeemer>;

export class OneshotOneshotSpend {
  public Script: Script;
  constructor(utxoRef: OutputReference, trace: boolean = false) {
    this.Script = cborToScript(
      applyParamsToScript(
        trace
          ? ""
          : "",
        Type.Tuple([
          Type.Object(
            {
              transaction_id: Type.String(),
              output_index: Type.BigInt(),
            },
            { ctor: 0n },
          ),
        ]),
        [utxoRef],
      ),
      "PlutusV3",
    );
  }
}
